import Link from "next/link";
import styles from "./SideBarNav.module.css";

const SideBarNav = () => (
  <nav class="navbar">
    <p class="p-3">brand name</p>
    <Link href="/">
      <a class="nav-link p-1">Home</a>
    </Link>
    <Link href="/search">
      <a class="nav-link active p-1">Search</a>
    </Link>
  </nav>
);

export default SideBarNav;
